import React from 'react';
import Navigation from './Navigation';
import ImageGallery from 'react-image-gallery';

import './style.css';

var images = [];

for (var i = 0; i < 20; i++) {
    var pagePath = './pages/p' + i.toString() + '.jpg';
    var thumbnailPath = './thumbnails/p' + i.toString() + '.jpg';

    images.push({ original: pagePath, thumbnail: thumbnailPath });
}

class App extends React.Component {

    render() {
        return (
            <div>
                <Navigation />
                <div>
                <p id="main" style={{ color: "green" }}>
                  <span id="number_of_cards">"Remaining cards: 52"</span>
                </p>
                <div>
                  <img
                    id="card"
                    src="https://deckofcardsapi.com/static/img/XX.png"
                    width={300}
                    height={400}
                    alt="card"
                  />
                </div>
                <p />
                <button onclick="newGame();">New Game/Reshuffle</button>
                <button onclick="drawCard();">Draw card</button>
                <button onclick="flipCard();">Flip card</button>
                <div>
                  <iframe
                    width={420}
                    height={345}
                    src="https://www.youtube.com/embed/tgbNymZ7vqY"
                    title="video"
                  ></iframe>
                </div>
              </div>
            </div>
        );
    };
}

export default App;
